import React from 'react';
import './App.css';

function App() {
  return (
    <div id="User">
     <div id='header'>
      <label id='name'>'The UnderTaker'</label>
      <label id='prof'>'Professional Wrestler'</label>
     </div>
     <div id='email'>
      <label>undertaker@gmail.com</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'></p>
     </div>
     </div>
    </div>
  );
}

export default App;
